import { Button , Card , message , Row , Col } from 'antd';
import axios from 'axios';

class Page extends React.Component{
	handleClick = () => {
		axios.get("http://44bcb284.ngrok.io/api/g1/tests")
		.then(response =>{
			console.log(response)
		})
		.catch(error => {
		 	console.log(error)	
		})
		//message.success("Button Clicked")
	}
	render(){
		return(<div>
				<Row>
					<Col span={24}>
						<Card className="container">
							<Button type="primary" className="click-btn" onClick={this.handleClick}>Create Article</Button>
						</Card>
					</Col>
				</Row>


			</div>
		)
	}
}
export default Page;
